import {useState} from 'react'

const Content = () => {
  return (
    
    <div>
      APPP </div>
  )
}
function Button(){
  const[count,setCount]= useState(0);
  return(
    <button onClick={() => setCount(count=>(count+1))}>New {count}</button>
  );
}
export {Button} ;

export default Content;
